///Return the frequency of word if it is in top 5000 most frequent of TASA. 
/// Otherwise return a probability that is one order of magnitude below 5000th word (approximately 10 times)
let GetFreq( word : string ) =
  match wordFreqMap.TryFind( word.Trim().ToLower() ) with
  | Some( x ) -> (float x) / wordFreqTotalCount
  | None -> 0.000001
